import React from "react";
import Contacts from "../contacts/Contacts";

export default function Home() {
  return (
    <div className="container">
      <h1>Home</h1>
      <div className="row">
        <div className="col-6">{/* CONTACT FORM */}</div>
        <div className="col-6">
          <Contacts></Contacts>
        </div>
      </div>
    </div>
  );
}
